음침한 성격에 학교를 싫어하며 어떠한 사정으로 알바만 하는 아싸 &#39;박두봉&#39; 
그런 두봉과는 반대로 성적 우수, 품행 단정에 친화력 높은 성격으로
반에서 가장 신뢰받는 인싸 의문의 전학생 &#39;한윤정&#39;
아싸와 인싸, 물과 기름처럼 극과 극으로 다른 둘의 좌충우돌 학교생활기!

&#34;이게 그 여자의 딸이라고?&#34;

고귀한 아델하이트 여왕의 사생아로서 젖 떼기도 전에 버림받고 
천덕꾸러기 신세로 방치되어 자랐던 소녀 타라는 

어느날 얼굴 한번 본 적 없는 악명 높은 서부의 대마법사 쥬다에게 보내진다.

타라의 후견인이라는 그의 비인간적으로 차가운 아름다움에 그녀는 압도되고,
그와 성의 식구들은 여왕을 혐오하며 조그만 계집아이를 꺼림칙하게 여긴다.

허나, 소녀의 순수하고 애처로운 사랑스러움은 
냉랭한 불사의 마도사의 심장마저 녹여버리는데……

&#34;애교 부리지 마. 여우 같으니라고.&#34;
&#34;왜 자꾸 나한테 여우라고 해요?&#34;

&#34;그 애가 설사 파멸이라해도 상관없어. 나에게 삶과 파멸은 매한가지니까.&#34;

오직 한 소녀에게만 다정한 집착 냉혈 &#39;후견인&#39;과 
상처 많은 조그만 &#39;아가씨&#39;의 힐링 로맨스 판타지.

지상 최강이지만 최약으로 살아가는 지지리.

최강의 무력을 가진 어머니와 조폭 가문의 아버지 사이에서 태어난 주인공 지지리(池知理). 갓난아기 때부터 집을 부수고 가구를 부수고 아버지를 부수(?)는 괴력을 발휘한다. 아버지와 어머니는 이런 지지리의 평범한 인생을 위해 지지리를 세뇌를 시킨다. 

&#34;넌 지상 최약체야&#34; &#34;그 누구와도 가까이 지내선 안돼&#34;

그 누구보다 아싸가 되고 싶은 지상 최강 찌질이의 트라우마 극복 성장기. 

&lt;강려크한 지지리&gt;

&#34;미오, 너는 꿈이 뭐야?&#34;
&#34;좋은 대학 가서 좋은 직장에 취업 하라고 했어, 엄마가.&#34;
&#34;아니, 너희 엄마 꿈 말고 미오 네 꿈 말이야.&#34;

지금껏 내가 아닌 엄마의 꿈을 대신 이루고 있던, 평범한 고 3 오미오.

현실의 이상을 좇는 대신 용기를 내어 보는 미오, 
어릴 적 엄마 몰래 숨겨야만 했던 &#39;그림&#39;이라는 꿈을 이루기 위해
미술 학원을 찾아가는데....

그런데 이 학원 뭔가 좀 이상하다?

파라오 원장에 천사 선생님, 그리고 북극곰 친구까지?!
특별한 미술 학원에서 일어나는 마법 같은 이야기.

늦어도 한참 늦은 고3 오!미오의
입시 미술 도전기, &lt;냐아! 미술학원&gt;

줄곧 나를 미워한 부모님은 친부모님이 아니었다. 내게 진짜 아빠가 따로 있다고 한다.
그래서 떠났다. 친아빠에게로.

*원작소설 &lt;대마법사의 딸&gt;
